(()=>{"use strict";(e=>{console.log(e);const t=document.getElementById("timer-hours"),n=document.getElementById("timer-minutes"),o=document.getElementById("timer-seconds"),s=()=>{let t=(new Date(e).getTime()-(new Date).getTime())/1e3;return{timeRemaining:t,hours:Math.floor(t/60/60),minutes:Math.floor(t/60%60),seconds:Math.floor(t%60)}},m=()=>{let e=s();t.textContent=e.hours<10?"0"+e.hours:e.hours,n.textContent=e.minutes<10?"0"+e.minutes:e.minutes,o.textContent=e.seconds<10?"0"+e.seconds:e.seconds};(()=>{let e;s().timeRemaining>0?e=setInterval(m,1e3):(t.textContent="00",n.textContent="00",o.textContent="00",clearInterval(e))})()})("22 march 2022")})();